import React from "react";
import './Menu.css'


function Menu (props){

    return(
        <nav classNme="header">
            <ul className="menu">
                <li className="men"><a href="http://localhost:3000">Home</a></li>
                <li className="men"><a href="./componentes/Formulario.js">Sobre</a></li>
                <li className="men"><a href="#">Serviços</a></li>
                <li className="men"><a href="#">Portifólio</a></li>
                <li className="men"><a href="#">Contato</a></li>
            </ul>
        </nav>
    )
}

export default Menu;
